import "./App.css";
import About from "./components/ComponentsIndex/About";
import Banner from "./components/ComponentsIndex/Banner";
import Contact from "./components/ComponentsIndex/Contact";
import Menu from "./components/ComponentsIndex/Menu";
import TopBar from "./components/ComponentsTopBar/TopBar";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <TopBar />
      <Banner />
      <About />
      <Menu />
      <Contact />
      <Footer />
    </div>
  );
}

export default App;
